        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

const Pet = props => {
  return <p>Hi my pets name is {props.pet}</p>
}



const Person = (props) => {
  return (
    <div>
    <p> hi i'm {props.name}</p>
      <Pet pet={props.petsName}/>
    </div>
  )
}


